import {BrowserRouter as Router,Routes,Route} from 'react-router-dom';

function Home() {
  return (
    <div>
      <Router>
        <Routes>
          <Route path='/animals' element={<Animals/>}/>
        </Routes>
      </Router>
    </div>
  )
}

export default Home
